def five_div_seq(n: int):
    count = 1
    for i in range(n - 1, 999, -2):
        str_i = str(i)
        if len(set(str_i)) >= 4 and '2' in str_i:
            if i % 9 == 0 or i % 14 == 0:
                count += str_i.count('5')
    return count

